import { URL } from "../Util/Constant";

if(!String.prototype.toDreamclassS3URL) {
  String.prototype.toDreamclassS3URL = function() { // eslint-disable-line no-extend-native
    if(this.startsWith("http")) {
      return this;
    } else {
      return URL.S3_DREAMCLASS + this;
    }
  };
}
